const data={

    //to get data of charts 
    getData:async function(regionName){
        const WorldDataApi = "https://nprelease.indiatimes.com/ncov19/trend_data_toi.json";
        const IndiaDataApi = "https://nprssfeeds.indiatimes.com/ncov19/trend_data_india_toi.json";

        try{
            return await(await fetch(regionName==="India"?IndiaDataApi:WorldDataApi)).json();
        }
        catch(err){
            console.log(err);
        }
    },

    //to get all states district data
    getDistrictWiseData:async function(){
        const api = "https://api.covid19india.org/state_district_wise.json";

        try{
            return await(await fetch(api)).json();
        }
        catch(err){
            console.log(err);
        }
    }

}

export default data;
